features.script:
feature.on('keys', e => {  
  k = e.keys
  player = parcel.players[0]
  boat = parcel.getFeatureById('lion') 
  x = boat.position.x
  y = boat.position.y
  z = boat.position.z 
  player.position.x = player.position.x + 1 
  if(k.a){ y = y + 1 }
  else if(k.b){ y = y - 1 }
  if(k.right){ x = x + 1 }
  else if(k.left){ x = x - 1 }
  else if(k.up){ z = z + 1 }
  else if(k.down){ z = z - 1 }
  boat.set({'position': [x, y, z] }) 
} )

boat = parcel.getFeatureById('alien') 
x = boat.position.x
y = boat.position.y
z = boat.position.z  
ox = boat.position.x
oy = boat.position.y
oz = boat.position.z  
feature.on('keys', e => {  
  k = e.keys 
  if(k.a){ oy=y; y = y + .01; }
  else if(k.b){ oy=y; y = y - .01;  }
  if(k.right){ ox=x; x = x + .01;  }
  else if(k.left){ ox=x; x = x - .01;  }
  else if(k.up){ oz=z; z = z + .01; }
  else if(k.down){ oz=z; z = z - .01; }
  let animation1 = boat.createAnimation('position')
  animation1.setKeys([
      { frame: 0, value: boat.position.add( new Vector3(ox, oy, oz) ) }, 
      { frame: 30, value: boat.position.add( new Vector3(x, y, z) ) },   
  ])
  boat.startAnimations( [animation1] )
} )

